import React from "react";
import Profile from '../Images/Profile.png';
import '../Components/Landing.css';

export default function Landing() {
  return (
    <div className="landing">
      <img src={Profile} alt="profile" className="profile-pic" />
      <div className="text-background">
        <h3 className="landing-header">Hello, I am</h3>
        <h1 className="landing-header-name">
          <span>Brett</span> Wallin
        </h1>
        <h2 className="landing-job-title">Full Stack Software Engineer</h2>
        <h3 className="landing-description">
          <span>I am a junior at Illinois State University majoring in computer science.</span>
          <span>I am also a passionate software engineer dedicated to continuous learning and growth.</span>
        </h3>
        <button className="landing-button">Contact Me</button>
      </div>
    </div>
  );
}
